import React from "react";
import DialogsBG from "./DialogsBG/DialogsBG";
import css from "./Dialogs.module.css";

function Dialogs(props) {
  return (
    <div className={css.messages}>
      <DialogsBG />
    </div>
  );
}

export default Dialogs;
